*{margin: 0; padding: 0; font-family: 'Uchen', serif;}
li{list-style: none;}
a{text-decoration: none; color: black;}



.header {
    width: 100%; height: 300px;
}
.gnb {
    width: 1276px; height: 30px;
    margin: 0 auto;
}
.gnb ul {
    float: right;
    position: relative;
}
.gnb ul li {
    display: inline-block;
    margin-right: 10px;
    line-height: 30px;
}
.gnb ul li:hover {
    text-shadow: 2px 2px 2px #666;
}
.gnb ul li a {
    font-family: 'Noto Serif KR', serif;
}

#chk { display: none;}
#chk:checked ~ .search_sheet {
    height: 40px;
}
#chk ~ .search_sheet {height: 0;}
.chk_btn {
    font-family: 'Noto Serif KR', serif;
    cursor: pointer;
}
.search_sheet {
    width: 300px; height: 0;
    text-align: center;
    position: absolute;
    top: 35px; right: -90px;
    transition: all .2s;
    overflow: hidden;
}
#search {
    width: 200px; height: 35px; 
    border: 0px;
    border-bottom: 1px solid black;
    font-size: 13px;
    font-family: 'Noto Serif KR', serif;
    outline: none;
}
.search_btn {
    width: 50px; height: 25px;
    font-family: 'Noto Serif KR', serif;
    background-color: white;
    border: 1px solid black;
    border-radius: 3px;
    cursor: pointer;
}
.search_btn:hover {
    background-color: black;
    color: white;
}
.header .logo {
    width: 957px; height: 135px;
    margin: 0 auto;
    margin-bottom: 70px;
    font-size: 150px;
    text-align: center;
    line-height: 135px;
}
.lnb {
    width: 600px;
    margin: 0 auto;
}
.lnb>ul>li>a{
    font-size: 30px;
}
.lnb>ul>li>a:hover {
    text-shadow: 3px 3px 3px #666;
}
.lnb li {
    width: 150px; height: 50px;
    margin: 0 auto;
    text-align: center;
    line-height: 50px;
    float: left;   
    background-color: white;
    position: relative;
}
.lnb li li {display: none;}
.lnb li:hover li {
    display: block;
}
.lnb li li:hover {
    font-weight: bold;
}



.detail {
    width: 1276px;
    box-sizing: border-box;
    margin: 0 auto;
}
.detail>div {
    width: 628px; height: 1000px;
    float: left;
    margin-right: 15px;
}
.detail>div:last-child {
    margin-right: 0;
}
.root {
    margin-top: 50px;
    font-size: 18px;
    margin-bottom: 20px;
}
.detail_sheet {
    width: 628px; height: 600px;
    overflow: hidden;
}
.thum01, .thum02, .thum03, .thum04 {
    width: 142px; height: 142px;
    float: left;
    margin-right: 20px;
    margin-top: 15px;
} 
.thum01 {
    background-image: url(./images/dtail011.jpg);
}
.thum02 {
    background-image: url(./images/dtail022.jpg);
}
.thum03 {
    background-image: url(./images/dtail033.jpg);
}
.thum04 {
    background-image: url(./images/dtail044.jpg);
    margin-right: 0;
}
.detail02 p {margin-bottom: 5px;}
.title {
    font-size: 50px;
    margin-top: 100px;
}
.price_box {
    width: 100%; height: 50px;
    font-size: 20px;
    margin-bottom: 50px;
}
.ko {
    font-family: 'Noto Serif KR', serif;
    font-size: 16px;
}
hr {margin-top: 50px;
    margin-bottom: 50px;
    border: 1px solid black;
}
#number {
    border-radius: 3px;
    width: 70px;
    outline: none;
}
.price_box2 {
    width: 628px; height: 70px;
    margin-bottom: 47px;
}
.order, .result_price {
    font-family: 'Noto Serif KR', serif;
    width: 300px; float: left;
    font-size: 20px;
}
.product_number,.result {
    width: 300px; height: 33px;
    background-color: white;
    float: right;
}

.btn_box {
    width: 628px; height: 60px;
    margin-bottom: 20px;

}
button {
    width: 50%; height: 60px;
    box-sizing: border-box;
    float: left;
    font-family: 'Noto Serif KR', serif;
    font-size: 30px;
    background-color: white;
    border: 1px solid black;
    cursor: pointer;
}
button:first-child {
    border-right: 0;
}
button:hover {
    background-color: black;
    color: white;
}
.detail_pic {
    width: 1286px;
    margin: 0 auto;
}
h1 {text-align: center;}

.product_sub {
    text-align: center;
    font-family: 'Noto Serif KR', serif;
}

.your-class {
    width: 1280px; height: 300px;
    margin-top: 30px;
    text-align: center;
}
.your-class a {
    display: inline-block;
    width: 304px; height: 300px;
    overflow: hidden;
}
.your-class a img {margin: 0 auto;}






.d_pic {
    width: 1286px; height: 4000px;
    margin-top: 100px;
}
.pic01 {
    width: 736px; height: 588px;
    background-image: url(./images/airair01.jpg);
    margin-left: 100px;
    box-shadow: 5px 5px 5px #666;
}
.pic02 {
    width: 736px; height: 588px;
    background-image: url(./images/airair02.jpg);
    margin-right: 100px;
    margin-top: 200px;
    margin-bottom: 200px;
    float: right;
    box-shadow: -5px 5px 5px #666;
}
.pic03 {
    width: 700px; height: 500px;
    background-image: url(./images/detail011.jpg);
    margin-bottom: 200px;
    float: left;
    margin-left: 20%;
}
.pic04 {
    width: 500px; height: 719px;
    background-image: url(./images/detail01.jpg);
    margin-bottom: 200px;
    float: left;
    margin-left: 27%;
    box-shadow: 5px 5px 5px #666;
}
.pic05 {
    width: 600px; height: 600px;
    background-image: url(./images/del01.jpg);
    margin-bottom: 200px;
    float: left;
    margin-left: 26%;
}



.review_section {
    width: 1286px; height: 400px;
    margin: 0 auto;
}

.review_title {
    text-align: left;
}
.review_title label {
    font-size: 16px;
    float: right;
}

.review_box {
    width: 1286px; height: 200px;
    border-top: 1px solid black;
    border-bottom: 1px solid black;
    margin-bottom: 20px;
    overflow: auto;
}

.write_box {
    width: 1286px; height: 250px;
    border: 1px solid black;
    box-sizing: border-box;
    overflow: hidden;
    margin-bottom: 20px;
    display: none;
}
#txt {
    width: 1286px; height: 200px;
    font-size: 16px;
    font-family: 'Noto Serif KR', serif;
    outline: none;
    border: 0;
}
#file{display: none;}
.upload_pic {
    display: inline-block;
    width: 50px; height: 50px;
    background-color: black;
    color: white;
    font-size: 20px;
    line-height: 50px;
    text-align: center;
    cursor: pointer;
}
.upload_pic:hover {background-color: #999;}
.save {
    width: 150px; height: 50px;
    font-size: 14px;
    float: right;
    border-right: 0;
    border-bottom: 0;
}
.close {
    width: 150px; height: 50px;
    font-size: 14px;
    float: right;
    border-right: 0;
    border-bottom: 0;
}
select {
    width: 100px; height: 30px;
    float: right;
    font-family: 'Noto Serif KR', serif;
    margin-right: 20px;
    outline: none;
    margin-top: 8px;
}
option {font-family: 'Noto Serif KR', serif;}
.post {
    width: 150px; height: 50px;
    font-size: 14px;
    float: right;
}
.txt_box {font-family: 'Noto Serif KR', serif;}
.del {
    margin-left: 50px;
    cursor: pointer;
    font-family: 'Noto Serif KR', serif;
}
.del:hover {
    color: #666;
}
.re_create {
    margin-left: 50px;
    margin-top: 10px;
    border-bottom: 1px solid #eee;
    margin-right: 50px;
}



.price_end {font-family: 'Noto Serif KR', serif;}
.footer {
    margin: 0 auto;
}
.footer>ul {
    width: 100%;
    border-bottom: 1px solid black;
    text-align: center;
    margin: 0 auto;
}
.footer ul li {
    display: inline-block;
    margin-right: 20px;
    font-size: 17px;
}
.footer_bottom {
    width: 1276px; height: 200px;
    margin: 0 auto;
}
.footer_bottom ul {
    width: 40%; height: 200px;
    float: left;
    display: flex;
    flex-direction: column;
    margin-left: 10%;
    margin-top: 20px;
}
.footer_bottom ul:nth-child(2) {
    margin-left: 0;
}
.btm01 li:first-child {
    font-size: 25px;
    font-weight: bold;
}
.btm01 li:last-child {
    font-size: 15px;
    line-height: 20px;
}
.btm02 li {
    font-size: 14px;
    line-height: 25px;
}
.btm02 li a {
    font-size: 14px;
}
.btm02 li span {
    font-size: 14px;
}



.quick {
    width: 40px; height: 280px;
    position: fixed;
    top: 30%; right: 0;
    background-color: white;
}
.quick li {
    width: 40px; height: 40px;
    font-size: 20px;
    line-height: 50px;
    text-align: center;
    position: relative;
}
.quick li:nth-child(5) {
    background-image: url(./images/kakao.jpg);
    background-size: 100%;
    background-position-x: -1px;
}
.quick li p {
    display: none;
    width: auto; height: 30px;
    border: 1px solid black;
    border-radius: 3px;
    box-sizing: border-box;
    padding: 0 5px;
    line-height: 30px;
    position: absolute;
    font-family: 'Noto Serif KR', serif;
    font-size: 13px;
    background-color: white;
}
.quick li:first-child p {
    top: 2px; left: -45px;
}
.quick li:nth-child(2) p {
    top: 2px; left: -70px;
}
.quick li:nth-child(3) p {
    top: 2px; left: -58px;
}
.quick li:nth-child(4) p {
    top: 2px; left: -90px;
}
.quick li:nth-child(5) p {
    top: 2px; left: -70px;
}
.quick li:nth-child(6) p {
    top: 2px; left: -45px;
}
.quick li:nth-child(7) p {
    top: 2px; left: -63px;
}
.quick li:hover p{display: block;}
